import { getRandomInt } from "./Random.js";

const FOOD_TYPES = {
  common: {
    type: "common",
    cost: 1,
  },
  rare: {
    type: "rare",
    cost: 5,
  },
  legend: {
    type: "legend",
    cost: 10,
  },
};
const getRandomType = () => {
  const rand = getRandomInt(20);
  if(random<=10){
    return {...FOOD_TYPES.common}
  }
  if(random<=19){
    return {...FOOD_TYPES.common}
  }
};

export const createFood = (boardSize = 0) => {
  const cord = { x: getRandomInt(boardSize), y: getRandomInt(boardSize) };
  console.log(cord);
  return { ...cord, ...FOOD_TYPES.common };
};
